def assignmentChanger (str):
    lines = str.split('\n')
    for line in lines:
        if len(line)==0:
            continue
        line = line.replace(';','')
        parts=line.split ('=')
        print ("%s=%s;"%(parts[1], parts[0]))

def nanopassAssigner (str):
    lines = str.split('\n')
    for line in lines:
        if len(line)==0:
            continue
        print ("%s=vValid? visData.%s : \"\", "%(line,line))

def ColToArr (str):
    tlines = str.split('\n')
    lines = [x for x in tlines if len(x)>0]
    restr = ", ".join(lines)
    restr = "{" + restr + "};"
    print (restr)


